import { __decorate } from "tslib";
import { Component } from '@angular/core';
let MovieComponent = class MovieComponent {
    constructor(movieService) {
        this.movieService = movieService;
    }
    ngOnInit() {
    }
    onSubmit(f) {
        this.searchMovie(f.value['title']);
    }
    async searchMovie(title) {
        this.movieService.getMovie(title)
            .subscribe(movie => {
            if (Object.keys(movie).length < 4) {
                console.log('movie not in db');
                alert("This movie isn't in the database :( ");
            }
            else {
                console.log(movie);
                this.movies = movie;
            }
        });
    }
};
MovieComponent = __decorate([
    Component({
        selector: 'app-movie',
        templateUrl: './movie.component.html',
        styleUrls: ['./movie.component.css']
    })
], MovieComponent);
export { MovieComponent };
